import React, {
  useState,
  forwardRef,
  useImperativeHandle,
  useEffect,
} from "react";
import { Modal, Spin, Typography } from "antd";
import "../../assets/css/common.css";
// import NetwrokError from "../../assets/svg-icons/Netwrok-error.svg";

const { Text } = Typography;

const MocktestErrorPopup = forwardRef(function MocktestErrorPopup(props, ref) {
  const [isModalVisible, setIsModalVisible] = useState(false);
  const [activeLoader, setActiveLoader] = useState(false);
  const [type, seType] = useState();

  useImperativeHandle(ref, () => {
    return {
      showErrorModal(type) {
        props.handleclearQInterval();
        setIsModalVisible(true);
        setActiveLoader(false);
        seType(type);
      },
      closeErrorModal() {
        setIsModalVisible(false);
      },
    };
  });

  useEffect(() => {
    window.addEventListener("online", handleClick);
    return () => {
      window.removeEventListener("online", handleClick);
    };
  }, []);

  const handleClick = (event) => {
    handleRefresh(type);
  };

  const handleRefresh = (type) => {
    setActiveLoader(true);
    props.handleLoader();
    setIsModalVisible(false);
    switch (type) {
      case "userrecord":
        props.getMockUserRecord("userrecordsave");
        break;
      case "submit":
        props.postMockQuestionSubmit();
        break;
      case "leave":
        props.submitLeaveMocktest();
        break;
      default:
        window.location.reload();
    }
  };

  return (
    <div>
      <Modal
        open={isModalVisible}
        footer={null}
        closable={false}
        centered={true}
        maskClosable={false}
        className="mock-popup-leave"
      >
        {activeLoader ? (
          <div style={{ padding: "50px", textAlign: "center" }}>
            <Spin size="large" />
          </div>
        ) : (
          <div style={{ padding: "25px" }}>
            <div className="mock-popup-modal-body-center">
              <OfflineIcon />
            </div>
            <div className="mock-popup-modal-body-center">
              <Text className="mock-popup-modal-body-leave">Network Error</Text>
            </div>
            <div className="mock-popup-modal-body-center">
              <Text className="mock-popup-modal-body-leave-content" strong>
                Connection interrupted. Please ensure you're connected to the
                internet and try again
              </Text>
            </div>
            {/* <div style={{ textAlign: "center" }}>
              <span
                className="quiz-popup-modal-body-report-footer-buttons"
                onClick={() => {
                  handleRefresh(type);
                }}
              >
                Refresh
              </span>
            </div> */}
          </div>
        )}
      </Modal>
    </div>
  );
});

export default MocktestErrorPopup;

const OfflineIcon = () => (
  <svg
    width="119"
    height="87"
    viewBox="0 0 119 87"
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
    xlink="http://www.w3.org/1999/xlink"
  >
    <rect
      x="0.679688"
      y="0.405273"
      width="117.958"
      height="85.9358"
      fill="url(#pattern0)"
    />
    <defs>
      <pattern
        id="pattern0"
        patternContentUnits="objectBoundingBox"
        width="1"
        height="1"
      >
        <use
          href="#image0_21676_1282"
          transform="scale(0.00153374 0.00210526)"
        />
      </pattern>
      <image
        id="image0_21676_1282"
        width="652"
        height="475"
        href="data:image/png;base64,"
      />
    </defs>
  </svg>
);
